#include <stdint.h>
#include <stdio.h>


typedef struct 
{
    /**< The width of data validation can range from 1 to 32 */
    uint8_t width;

    /**< Flag for reversing input data */
    uint8_t refin; 

    /**< Flag for reversing output data */
    uint8_t refout; 

    /**< Calculating polynomials, the effective width must be consistent with the width, and any excess parts will be invalid */
    uint32_t poly;

    /**< Calculated initial value */
    uint32_t init; 

    /**< Result XOR output value */
    uint32_t xorout;
} crcOptType;

static uint8_t rf8(uint8_t data)
{
    uint8_t xor = 0;
    uint8_t i = 4;
    while (i--)
    {
        xor |= ((data >> ((i << 1) + 1)) ^ data) & (1 << (3 - i));
        xor |= ((xor << ((i << 1) + 1)) & (1 << (4 + i)));
    }
    return xor ^ data;
}

static uint16_t rf16(uint16_t data)
{
    uint16_t xor = 0;
    uint16_t i = 8;
    while (i--)
    {
        xor |= ((data >> ((i << 1) + 1)) ^ data) & (1 << (7 - i));
        xor |= ((xor << ((i << 1) + 1)) & (1 << (8 + i)));
    }
    return xor ^ data;
}

static uint32_t rf32(uint32_t data)
{
    uint32_t xor = 0;
    uint32_t i = 16;
    while (i--)
    {
        xor |= ((data >> ((i << 1) + 1)) ^ data) & (1 << (15 - i));
        xor |= ((xor << ((i << 1) + 1)) & (1 << (16 + i)));
    }
    return xor ^ data;
}

