uint32_t crc_t(uint8_t* data, uint32_t len, const crcOptType * const opt)
{
    uint8_t i;
    uint32_t crc;
    uint32_t poly;

    if (!data) return 0;
    if (!opt) return 0;
    if (opt->width == 0 || opt->width > 32) return 0;

    crc = opt->init;
    poly = opt->poly;

    if (opt->refin)
    {
        poly = rf32(poly) >> (32 - opt->width);
        crc = rf32(crc) >> (32 - opt->width);
        while (len--)
        {
            crc ^= *data++;
            for (i = 0; i < 8; i++)
            {
                if (crc & 0x1) crc = (crc >> 1) ^ poly;
                else crc >>= 1;
            }
        }
        if (!opt->refout)
        {
            crc = rf32(crc);
            crc >>= (32 - opt->width);
        }
    }
    else  
    {
        crc <<= (32 - opt->width);
        poly <<= (32 - opt->width);
        while (len--)
        {
            crc ^= (uint32_t)(*data++) << 24;
            for (i = 0; i < 8; i++)
            {
                if (crc & 0x80000000) crc = (crc << 1) ^ poly;
                else crc <<= 1;
            }
        }
        if (opt->refout) crc = rf32(crc);
        else crc >>= (32 - opt->width);
    }
    crc ^= opt->xorout;
    return crc;
}

